import React from 'react';
import ReactAnime from 'react-animejs'
const { Anime, stagger } = ReactAnime
import './style.css'

export default App => {

    return (
        <div className="App">
            <Anime
                initial={[
                    {
                        targets: "#h1",
                        translateX: 50,
                        easing: "linear"
                    }
                ]}
            >
                <h1 className='animated'>FRANK HUI</h1>
            </Anime>

        </div>
    )

}
